import React, { useState } from "react";
import Box from "@mui/material/Box";
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import Tooltip from '@mui/material/Tooltip';
import IconButton from '@mui/material/IconButton';
import ArrowBackIcon from '@mui/icons-material/ArrowBack';
import Grid from "@mui/material/Grid";
import TextField from "@mui/material/TextField";
import LandscapeIcon from "@mui/icons-material/Landscape";
import Typography from "@mui/material/Typography";
import MenuItem from "@mui/material/MenuItem";
import Button from "@mui/material/Button";
import { NavLink } from "react-router-dom";

const districts = [
  "Thiruvanathapuram",
  "Kollam",
  "Pathanamthitta",
  "Alappuzha",
  "Kottayam",
  "Idukki",
  "Ernakulam",
  "Thrissur",
  "Palakkad",
  "Malappuram",
  "Wayanad",
  "Kozhikode",
  "Kannur",
  "Kasargod",
];

export default function NewLand() {

  const [district, setDistrict] = React.useState("");
  const [taluk, setTaluk] = useState("");
  const [surveyNo, setSurveyNo] = useState("");
  const [village, setVillage] = useState("");
  const [blockNo, setBlockNo] = useState("");
  const [price, setPrice] = useState("");
  const [area, setArea] = useState("");
  const [hash, setHash] = useState("");
  const [file, setFile] = useState("");
  const [fileName, setFileName] = useState("");

  const handleDistricChange = (event) => {
    setDistrict(event.target.value);
  };

  const talukChangeHandler = (event) => {
    setTaluk(event.target.value);
  };

  const surveyNoChangeHandler = (event) => {
    setSurveyNo(event.target.value);
  };

  const villageChangeHandler = (event) => {
    setVillage(event.target.value);
  };

  const blockNoChangeHandler = (event) => {
    setBlockNo(event.target.value);
  };

  const priceChangeHandler = (event) => {
    setPrice(event.target.value);
  };

  const areaChangeHandler = (event) => {
    setArea(event.target.value);
  };

  const fileChangeHandler = (event) => {
    setFile(event.target.files[0]);
    setFileName(event.target.files[0].name);
  };

  const submitHandler = async (event) => {
    event.preventDefault();
  };

  return (
    <div>
      <Box sx={{ flexGrow: 1 }}>
        <AppBar position="static">
          <Toolbar>
            <Tooltip title="Back to Marketplace">
              <IconButton
                size="large"
                color="inherit"
              >
                <NavLink to="/" ><ArrowBackIcon /></NavLink>
              </IconButton>
            </Tooltip>
            <Typography variant="h5" component="div" sx={{ flexGrow: 1 }}>
              LAND MARKETPLACE
            </Typography>
          </Toolbar>
        </AppBar>
      </Box>
      <Box sx={{ paddingLeft: 30, paddingTop: 2, flexGrow: 1, maxWidth: "80%" }}>
        <div>
          <Typography variant="h4">
            Register a Land for Sale!{" "}
            <LandscapeIcon fontSize="large" color="secondary" />
          </Typography>
        </div>
        <br />

        <form noValidate onSubmit={submitHandler}>
          <Grid container spacing={2}>
            <Grid item xs={4}>
              <TextField
                select
                required
                label="DISTRICT"
                value={district}
                onChange={handleDistricChange}
                helperText="Select the district where the land is located"
                variant="outlined"
                sx={{ width: "100%" }}
              >
                {districts.map((district) => (
                  <MenuItem key={district} value={district}>
                    {district}
                  </MenuItem>
                ))}
              </TextField>
            </Grid>
            <Grid item xs={4}>
              <TextField
                required
                label="TALUK"
                id="taluk"
                helperText="Provide the taluk name where the land is located"
                variant="outlined"
                onChange={talukChangeHandler}
                sx={{ width: "100%" }}
              />
            </Grid>
            <Grid item xs={4}>
              <TextField
                required
                label="VILLAGE"
                id="village"
                helperText="Provide the village name where the land is located"
                variant="outlined"
                onChange={villageChangeHandler}
                sx={{ width: "100%" }}
              />
            </Grid>
            <Grid item xs={4}>
              <TextField
                id="filled-basic"
                required
                label="Survey No."
                variant="outlined"
                helperText="Provide the Survey No. of the land"
                onChange={surveyNoChangeHandler}
                sx={{ width: "100%" }}
              />
            </Grid>
            <Grid item xs={4}>
              <TextField
                id="filled-basic"
                label="Block No."
                helperText="Provide the Block No of the ward where the land is located"
                variant="outlined"
                onChange={blockNoChangeHandler}
                sx={{ width: "100%" }}
              />
            </Grid>
            <Grid item xs={4}>
              <TextField
                id="filled-basic"
                label="Area"
                helperText="Provide the land area (in ares)"
                variant="outlined"
                onChange={areaChangeHandler}
                sx={{ width: "100%" }}
              />
            </Grid>
            <Grid item xs={12}>
              <TextField
                required
                label="PRICE"
                variant="outlined"
                helperText="Provide the auction start price for the land (specify in wei)"
                onChange={priceChangeHandler}
                sx={{ width: "100%" }}
              />
            </Grid>

            <Grid item xs={12}>
              <div>
                <Typography>
                  Upload all the required documents in a single PDF file.
                </Typography>
                <input
                  accept="application/pdf"
                  onChange={fileChangeHandler}
                  style={{ display: "none" }}
                  id="button-file"
                  multiple
                  type="file"
                />
                <label htmlFor="button-file">
                  <Button variant="contained" component="span">
                    Upload Documents
                  </Button>
                  <p>{fileName}</p>
                </label>
              </div>
              <div>
                <Typography variant="h6">
                  <b>DECLARATION</b>
                </Typography>
                <Typography>
                  I agree that the above information is correct and complete to
                  the best of my knowledge and belief.
                </Typography>
                <br />
                <Button
                  type="submit"
                  fullWidth
                  variant="contained"
                  color="primary"
                >
                  Register Land for Auction
                </Button>
              </div>
            </Grid>
          </Grid>
        </form>
      </Box>
    </div>
  );
}
